import HeaderComponent from './components/HeaderComponent/HeaderComponent'
import { Link } from 'react-router-dom';

function App() {
  return ( 
    <div className="App">
      <header>
        <HeaderComponent/>
      </header>
      <main>
      <Link to="/" className="header-logo">
                    LOGOLINK
                </Link>
        <h2>main</h2>
      </main>
      <footer>
        <h3>footer</h3>
      </footer>
    </div>
  );
}

export default App;
